import React, { useState } from 'react';
import Form from './Form';

const App = () => {
  const callApi = async () => {
    const response = await fetch(
      'https://api.openweathermap.org/data/2.5/weather?q=Philadelphia&appid=09cb87e3b19945bb6949563cd21ace23'
    );
    const data = await response.json();
    const temp = data.main.temp;

    return temp;
  };

  console.log(callApi());

  return <Form />;
};

export default App;
